import GoBack from "../Atoms/goBack";
import Navitage from "../Modules/navigate";
import PlayGame from "../Atoms/playGame";
import ExplanationBox from "../Atoms/explanationBox";

function DetailPage() {
    return (
        <div>
            <div style={{ display: "flex" }}>
                <Navitage />
                <PlayGame />
            </div>
            <ExplanationBox />

        </div>
    )
}

export default DetailPage;
